import React, { useContext } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { auth } from "./firebase";
import { BsPlusSquare } from "react-icons/bs";
import { useNavigate } from "react-router-dom";
import './home.css';
import { Appcontext } from "./Navi";

function Navbar() {
    const navigate = useNavigate();
    const {userauth} = useContext(Appcontext);
    const handleaddpost = () => {
        navigate('/Addpost');
    }
    return ( 
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
            <div className="container">
            <a href="/" className="navbar-brand fw-bolder" >instagram</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse"  data-target ="#mynavbar"
            aria-controls="mynavbar" aria-label="Toggle navigation" aria-expanded="false">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse " id="mynavbar"> 
            <ul className="navbar-nav ms-auto">
                <li className="nav-item"><a href="/home" className="nav-link">Home</a></li>
                <li className="nav-item"><a href="/addpost" className="nav-link"> Post  (<BsPlusSquare size={18} onClick={handleaddpost}></BsPlusSquare>)
                </a></li>
            </ul>
            </div>
            </div>
            </nav>
            {  userauth && <img className="logo" src={auth.currentUser?.photoURL} alt="user" ></img>}
            {  userauth ==="" && <button type="submit" className="btn1" onClick={()=>{navigate( "/" )}}>Login</button> 
            }
        </div>
     );
}

export default Navbar;
